"use strict";(self.webpackChunkmy_website=self.webpackChunkmy_website||[]).push([[9705],{396:(e,n,t)=>{t.r(n),t.d(n,{assets:()=>l,contentTitle:()=>r,default:()=>d,frontMatter:()=>i,metadata:()=>s,toc:()=>h});var o=t(4848),a=t(8453);const i={sidebar_position:1},r="About Me",s={id:"life/about",title:"About Me",description:"I have many great hobbies outside of work. I enjoy cooking and take pleasure in wine tasting and exploring craft beers. Outdoor activities like hiking, fishing, surfing, and sailing, a skill I picked up in 2023, are among my favorite outdoor activiviesS. I've recently taken up golf, but my lifelong sports have been soccer and wrestling. I currently participate in intramural soccer at UMaine and plan to join adult leagues post-graduation. My connection to wrestling remains strong through my volunteer coaching at Kennebunk High School and practicing with the UMaine Wrestling Team. In 2022, I discovered a love for gardening, enjoying the fruits of my labor with fresh strawberries, carrots, tomatoes, and beautiful flowers.",source:"@site/docs/life/about.md",sourceDirName:"life",slug:"/life/about",permalink:"/docs/life/about",draft:!1,unlisted:!1,tags:[],version:"current",sidebarPosition:1,frontMatter:{sidebar_position:1},sidebar:"lifeSidebar",next:{title:"My Menu",permalink:"/docs/category/my-menu"}},l={},h=[{value:"Leadership",id:"leadership",level:3},{value:"Wine, Cooking, Beer",id:"wine-cooking-beer",level:3},{value:"Outdoors",id:"outdoors",level:3},{value:"Sports",id:"sports",level:3}];function c(e){const n={a:"a",h1:"h1",h3:"h3",p:"p",strong:"strong",...(0,a.R)(),...e.components};return(0,o.jsxs)(o.Fragment,{children:[(0,o.jsx)(n.h1,{id:"about-me",children:"About Me"}),"\n",(0,o.jsx)(n.p,{children:(0,o.jsx)(n.strong,{children:"I have many great hobbies outside of work. I enjoy cooking and take pleasure in wine tasting and exploring craft beers. Outdoor activities like hiking, fishing, surfing, and sailing, a skill I picked up in 2023, are among my favorite outdoor activiviesS. I've recently taken up golf, but my lifelong sports have been soccer and wrestling. I currently participate in intramural soccer at UMaine and plan to join adult leagues post-graduation. My connection to wrestling remains strong through my volunteer coaching at Kennebunk High School and practicing with the UMaine Wrestling Team. In 2022, I discovered a love for gardening, enjoying the fruits of my labor with fresh strawberries, carrots, tomatoes, and beautiful flowers."})}),"\n",(0,o.jsx)(n.h3,{id:"leadership",children:"Leadership"}),"\n",(0,o.jsxs)(n.p,{children:["As a leader, I have a motto that I follow to guide myself: ",(0,o.jsx)(n.strong,{children:"Give credit, take blame"}),". What this means to me is to always recognize your peers and your followers for their effort and contribution, and to never hide from your failures or shortcomings. Failure and a strong growth mindset can push a motivated person to be a great leader. In my career and in my personal life, I have had many setbacks, but I'm proud that I've kept moving foward to overcome those challenges. I strive to be an empathetic leader, and an effective follower. My leadership in sports and in my career have pushed me to learn how to take action and rally a team towards an objective. I hope I can inspire other's to be leaders in their life where they are passionate."]}),"\n",(0,o.jsx)(n.h3,{id:"wine-cooking-beer",children:"Wine, Cooking, Beer"}),"\n",(0,o.jsxs)(n.p,{children:[(0,o.jsx)(n.strong,{children:"Wine -"})," I enjoy trying new wines and wine pairings. I owe many thanks to Betsy Ross at ",(0,o.jsx)(n.a,{href:"https://www.winehousemaine.com/",children:"Wine House On Maine"})," for introducing me to so many great wines. When I started my wine journey, I only liked fruity whites and ros\xe9s, but I've really grown to appreciate red wine. My favorite in particular is Cabernet Sauvignon."]}),"\n",(0,o.jsxs)(n.p,{children:[(0,o.jsx)(n.strong,{children:"Cooking -"})," I make a mean pizza, I've recently been learning how to make bread from scratch, and I also make pasta from scratch. I regularly cook a range of recipes but I love italian food. My favorite dish to make is shrimp scampi with homemade pasta."]}),"\n",(0,o.jsxs)(n.p,{children:[(0,o.jsx)(n.strong,{children:"Beer -"})," Beer is a very popular subject in college. I was lucky enough to take a course on it - Brewing with Food Science. The course focused on the process of beer making as well as the ingredients that go into beer and their functions. I love going to breweries with my friends, my favorite one in particualr is ",(0,o.jsx)(n.a,{href:"https://www.marshislandbrewing.com/",children:"Marsh Island Brewing"}),", they make a killer stout."]}),"\n",(0,o.jsx)(n.h3,{id:"outdoors",children:"Outdoors"}),"\n",(0,o.jsxs)(n.p,{children:[(0,o.jsx)(n.strong,{children:"Fishing -"})," I love to fish and I'm a proponent of wildlife conservation. I have been fishing with my Dad and my brother for as long as I can remember. My favorite species to  target are striped bass, large mouth bass, small mouth bass, brook trout, and lake trout."]}),"\n",(0,o.jsxs)(n.p,{children:[(0,o.jsx)(n.strong,{children:"Sailing -"})," In the summer of 2023, while I was interning at General Dynamics Electric Boat, I decided I wanted to learn how to sail. My office was located in New London, CT., which is just next door to historic Mystic, CT. The sailing culture in eastern CT is almost as great as Newport, RI. Sailing lessons were expensive, so I sought an alternative route. I researched local sail boats, and emailed ",(0,o.jsx)(n.a,{href:"https://www.marinepro.net/",children:"Captain Stuart Reininger"}),". I made a great deal with Captain Stu, I would volunteer on his boat as a deckhand, and he would teach me how to sail. Throughout my 8 weeks in CT, I got to sail ",(0,o.jsx)(n.strong,{children:"Tall Tales"}),", a 35-foot ocean-crossing sailing cutter. This was an unforgetable experience, and I hope I can continue sailing as I continue my career."]}),"\n",(0,o.jsxs)(n.p,{children:[(0,o.jsx)(n.strong,{children:"Gardening -"})," I enjoy working on my garden at home. I have a passion for landscaping, and one day I want to build a big garden at my home. This year, I am looking to grow potatoes and more spices."]}),"\n",(0,o.jsxs)(n.p,{children:[(0,o.jsx)(n.strong,{children:"Hiking -"})," Some of my favorite hikes in New England are Tumbledown Mountain, and Mount Chocorua."]}),"\n",(0,o.jsxs)(n.p,{children:[(0,o.jsx)(n.strong,{children:"Surfing -"})," I love to surf but unfortunately do not make it out in the water too often. Between school and internships, surfing always gets put on the back burner. After college, I hope I can continue this hobby as my schedule becomes more consistent."]}),"\n",(0,o.jsx)(n.h3,{id:"sports",children:"Sports"}),"\n",(0,o.jsxs)(n.p,{children:[(0,o.jsx)(n.strong,{children:"Wrestling -"})," Growing up, wrestling was a big part of my life. Through wrestling I learned how to overcome physical and mental challenges, and push myself further than I thought I could ever go. I finished my high school career with 109 wins, placing 3rd at the Maine State Championship at 120 lb weight class. I was the captain of the Kennebunk High School wrestling team, and the President of the University of Maine Wrestling team."]}),"\n",(0,o.jsxs)(n.p,{children:[(0,o.jsx)(n.strong,{children:"Golf -"})," I started my golf career when I worked at ",(0,o.jsx)(n.a,{href:"https://webhannetgolfclub.com/",children:"Webhannet Golf Club"})," in Kennebunk, Maine. Every morning I mowed the greens before opening the course to players. As a benefit of working there, I got to golf for free in the evenings. My favorite thing about golf is the serenity out on the fairways. My personal best game was when I shot a 93 at Shipyard Golf Club in Hilton Head Island."]}),"\n",(0,o.jsxs)(n.p,{children:[(0,o.jsx)(n.strong,{children:"Soccer -"})," I was never the greatest player on the soccer field, but I always strived to be the hardest working. In high school I played outside back, and left and right wing. Now that I play in co-ed leagues in college, I usually play midfield. My favorite teams are Arsenal, Liverpool, and New England Revolution."]})]})}function d(e={}){const{wrapper:n}={...(0,a.R)(),...e.components};return n?(0,o.jsx)(n,{...e,children:(0,o.jsx)(c,{...e})}):c(e)}},8453:(e,n,t)=>{t.d(n,{R:()=>r,x:()=>s});var o=t(6540);const a={},i=o.createContext(a);function r(e){const n=o.useContext(i);return o.useMemo((function(){return"function"==typeof e?e(n):{...n,...e}}),[n,e])}function s(e){let n;return n=e.disableParentContext?"function"==typeof e.components?e.components(a):e.components||a:r(e.components),o.createElement(i.Provider,{value:n},e.children)}}}]);